import ClientEdit from "./ClientEdit";
import ClientList from "./ClientList";






 const App = () => {




  return (
   <BrowserRouter >
    <Switch>
    <Route exact path="/" component={ClientList}/>
    <Route path='/clients/:id' component={ClientEdit}/>

    </Switch>

   </BrowserRouter>

);
};
export default App;
